import React from "react";

function Main(props) {
  const containers = ["Top shelf", "Middle shelf", "Lower shelf"];
  return (
    <>
      <sectiontitle>
        <h1>My Fridge</h1>
      </sectiontitle>
      <ul>
        {props.containers.map((container) => (
          <li>{container}</li>
        ))}
      </ul>
    </>
  );
}

export default Main;
